import s from './Home.module.css';

function Home() {
    return (
        <div className={s.home}>
            <img className={s.backgroundImg} src="https://webitkurigram.com/html/marino/assets/images/slider-1.png" alt="" />
            <span>
              Բարև ես Տիգրանեմ Խերանյանն եմ!
            </span>
            <span>
                
            </span>
        </div>
    );
}

export default Home;
